import React from 'react'
import {Row, Col} from 'antd'

import ModalCreatePoll from './ModalCreatePoll'
import PollsTable from './PollsTable'

class PollComponent extends React.PureComponent {
  render() {
    return(
      <div className='wrapper-polls'>
        <Row>
          <Col span={12} style={{display: 'flex', justifyContent: 'flex-start'}}>
            {`You have created ${this.props.webinarPolls.length} poll for this meeting.`}
          </Col>
          <Col span={12} style={{display: 'flex', justifyContent: 'flex-end'}}>
            <ModalCreatePoll webinarId={this.props.webinarId} />
          </Col>
        </Row>
        <PollsTable webinarId={this.props.webinarId} webinarPolls={this.props.webinarPolls} />
      </div>
    )
  }
}

export default PollComponent
